The Dead Weather is an American indie rock supergroup that formed in Nashville, Tennessee in 2009. Comprising vocalist Alison Mosshart (of The Kills), guitarist Dean Fertita (of Queens of the Stone Age), bassist Jack Lawrence (of The Raconteurs and The Greenhornes) and lead/ bass guitarist/ vocalist Jack White (of The White Stripes and The Raconteurs). The Dead Weather was revealed at the opening of Third Man Records' new headquarters in Nashville on March 11, 2009. The band performed for the first time at the event, before immediately releasing their debut single &quot;Hang You from the Heavens&quot;.

